import HomeIcon from '@mui/icons-material/Home';
import InfoIcon from '@mui/icons-material/Info';
import BookmarksIcon from '@mui/icons-material/Bookmarks';


export const NavData = [
    {
    id: 0,
    icon: <HomeIcon/>,
    text: "Home",
    link: "/"
    },
    {
    id: 1,
    icon: <InfoIcon/>,
    text: "About",
    link: "/about"
    },
    {
    id: 2,
    icon: <BookmarksIcon/>,
    text: "Recipes",
    link: "/recipes"
    }
]

export default NavData
